import styled from 'styled-components';
import { Form as AntdForm } from 'antd';

export const FormContainer = styled.div`
  padding: 50px;
`

export const Form = styled(AntdForm)`
  > div.ant-form-item {
    height: 400px;
    display: flex;
    align-items: center;
  }
`;
